"use strict";export const transformUserOP=e=>{try{const r={...e},o=["nonce","callGasLimit","verificationGasLimit","preVerificationGas","maxFeePerGas","maxPriorityFeePerGas"];for(const t of o)r[t]&&r[t]!=="0x"&&(r[t]="0x"+BigInt(e[t]).toString(16));return r}catch(r){throw`Failed to transform user operation: ${r}`}},getTimestampInSeconds=()=>Math.floor(Date.now()/1e3);
